import { Component } from '@angular/core';

@Component({
  selector: 'app-client-management',
  templateUrl: './client-management.component.html',
  styleUrls: ['./client-management.component.css']
})
export class ClientManagementComponent {
  clientName: string = '';
  clientEmail: string = '';

  registerClient() {
    // Here, you can implement the logic to send the client data to the server using Angular HttpClient.
    // You can access the values like this.clientName and this.clientEmail.
    console.log('Client Name:', this.clientName);
    console.log('Client Email:', this.clientEmail);
  }

  cancelRegistration() {
    // Implement the logic to cancel the registration here.
    console.log('Registration canceled.');

  }
}



<p>client-management works!</p>
<section id="client-form">
    <h1>Create a Client</h1>
    <h6>Please fill in this form to create a client</h6>
    <form (submit)="registerClient()">
        <div class="form-group">
            <label for="client-name">Name:</label><br>
            <input type="text" id="client-name" [(ngModel)]="clientName" name="clientName" required placeholder="Enter Name"><br>
        </div><br>
        <div class="form-group">
            <label for="client-email">Email:</label><br>
            <input type="email" id="client-email" [(ngModel)]="clientEmail" name="clientEmail" placeholder="Enter Email"/>
        </div><br>
         <div class="form-group">
            <label for="client-Address">Address:</label><br>
            <input type="Address" id="client-Address" [(ngModel)]="clientAddress" name="clientAddress" placeholder="Enter Address"/>
        </div><br>
        <div class="form-group">
            <label for="client-passwaod">Password:</label><br>
            <input type="Password" id="client-passwaod" [(ngModel)]="client-Password" name="clientPassword" placeholder="Enter Password"/>
        </div><br>
        <div class="form-group">
            <label for="client-Repeat-Password">Repeat Password:</label><br>
            <input type="Password" id="client-passwaod" [(ngModel)]="clientPassword" name="client-Password" placeholder="Enter Repeat-Password"/>
        </div><br>
        <!-- Add the rest of your form fields similarly -->
        <div class="form-group">
            <input type="submit" value="Register" class="custom-button">
            <input type="button" (click)="cancelRegistration()" value="Cancel" class="custom-button1">
        </div>
    </form>
</section>
